import React from "react";

const Bio = () => {
  return (
    <div>
      <div className="Biography">
        <h3>A propos de moi :</h3>
        <p>
          Hello! Je m'appelle Sofiane, bienvenu sur mon portfolio, 
          je suis un jeune développeur actuellement en formation à
          Epitech Paris, je suis quelqu'un de très créatif et je ne 
          recul devant aucun obstacle, je suis passionné par la création
          de contenu, que ce soit du code, des images ou encore des vidéos.
          Je n'hésiterai pas à faire part de mes qualités créatives dans mon 
          travail, et ce, afin de donner le meilleur de moi-même. 

        </p>
      </div>
    </div>
  );
};

export default Bio;
